Table A.1: Summary of the posterior means of γa​v​gsubscript𝛾𝑎𝑣𝑔\gamma_{avg} based on subsamples of various sizes given by three different methods compared to the posterior mean of γa​v​gsubscript𝛾𝑎𝑣𝑔\gamma_{avg} based on the full data.
The causal estimand here is the average log probability ratio γa​v​gsubscript𝛾𝑎𝑣𝑔\gamma_{avg}. We consider the causal estimand over the whole subsample, as well as over several subgroups.
hsdip+ (or −-): enrollees who had (or lacked) a high school diploma;
age >> (or ≤\leq) 35: enrollees who are older than 35 (or not);
newmar+ (or −-): enrollees who never (or ever) married;
divwid+ (or −-): enrollees who were divorced or widowed (or not).
In each case, boldface corresponds to the smallest MSE among the three methods considered.
